import React from "react";
import { SafeAreaView, StyleSheet, Text, TouchableOpacity, View,Image, TextInput } from "react-native";

import { useNavigation } from "@react-navigation/native";






export default function Cadastro() {
    const navigation = useNavigation()

    return (
        <SafeAreaView style={styles.container}>
          <Image style={styles.Image} source={require("../../../assets/fotocapa.jpg")} />
            
            <TextInput style={styles.input} placeholder="NOME"/>
            <TextInput style={styles.input} placeholder="E-mail"/>
            <TextInput style={styles.input} placeholder="Senha"/>
            <TextInput style={styles.input} placeholder="Confirmar s"/>
            <TouchableOpacity onPress={() => navigation.navigate("Testo")}>
                <Text>Mudar</Text>
            </TouchableOpacity>
        </SafeAreaView>

    );
}
const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
    },
    Image: {
        fontSize: 30,
        marginStart: 30,


    },
})
